import {  } from "./login.css";

export function FormularioLogin(params) {

return(

<Fragment>

<div id="divLogin">

<label>Email

<input type="email"></input>

</label>

<label>Documento de identidad

<input type="number"></input>

</label>

<button onClick={VerInfo}>verificar informacion </button>

